import {makeAutoObservable} from "mobx";

export default class PositionStore {
    constructor() {
        this._posotions = [];
        makeAutoObservable(this);
    }

    setPosition(positions) {
        this._posotions = positions;
    }

    get positions() {
        return this._positions;
    }
}
